description:
The Pirates of Dark Water is a fantasy animated series produced by Hanna-Barbera
and Turner Entertainment in the early 1990s. The series followed a group of
adventurers on a quest to collect the Thirteen Treasures of Rule, which possessed
the combined power to stop an evil substance known as &quot;Dark Water&quot; from consuming
the alien world of Mer.
